        return (
            <>
                <div style={{background:`url(${HeaderBg})`, backgroundPosition:'center', backgroundSize:'cover', backgroundRepeat:'no-repeat', width:'100%', paddingTop:'calc(152% - 55px)'}}>
                </div>

                <hr/>
            </>
        );
    }
}

export default Header;
